    "contracts/BIFI/utils/UniswapV3Utils.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./Path.sol";
import "../interfaces/common/IUniswapRouterV3WithDeadline.sol";
import "../interfaces/common/IUniswapV3Quoter.sol";

library UniswapV3Utils {
    using Path for bytes;

    // Swap along an encoded path using known amountIn
    function swap(
        address _router,
        bytes memory _path,
        uint256 _amountIn
    ) internal returns (uint256 amountOut) {
        IUniswapRouterV3WithDeadline.ExactInputParams memory params = IUniswapRouterV3WithDeadline.ExactInputParams({
            path: _path,
            recipient: address(this),
            deadline: block.timestamp,
            amountIn: _amountIn,
            amountOutMinimum: 0
        });
        return IUniswapRouterV3WithDeadline(_router).exactInput(params);
    }

    // Swap along a token route using known fees and amountIn
    function swap(
        address _router,
        address[] memory _route,
        uint24[] memory _fee,
        uint256 _amountIn
    ) internal returns (uint256 amountOut) {
        return swap(_router, routeToPath(_route, _fee), _amountIn);
    }

    function swapSingleInput(
        address _router,
        address _tokenIn,
        address _tokenOut,
        uint24 _fee,
        uint256 _amountIn
    ) internal returns(uint256) {
        IUniswapRouterV3WithDeadline.ExactInputSingleParams memory params = IUniswapRouterV3WithDeadline.ExactInputSingleParams({
            tokenIn: _tokenIn,
            tokenOut: _tokenOut,
            fee: _fee,
            recipient: address(this),
            deadline: block.timestamp,
            amountIn: _amountIn,
            amountOutMinimum: 0,
            sqrtPriceLimitX96: 0
        });

        return IUniswapRouterV3WithDeadline(_router).exactInputSingle(params);
    }

    function swapSingleOutput(
        address _router,
        address _tokenIn,
        address _tokenOut,
        uint24 _fee,
        uint256 _amountOut
    ) internal returns(uint256) {
        IUniswapRouterV3WithDeadline.ExactOutputSingleParams memory params = IUniswapRouterV3WithDeadline.ExactOutputSingleParams({
            tokenIn: _tokenIn,
            tokenOut: _tokenOut,
            fee: _fee,
            recipient: address(this),
            deadline: block.timestamp,
            amountOut: _amountOut,
            amountInMaximum: type(uint).max,
            sqrtPriceLimitX96: 0
        });

        return IUniswapRouterV3WithDeadline(_router).exactOutputSingle(params);
    }

    // Convert encoded path to token route
    function pathToRoute(bytes memory _path) internal pure returns (address[] memory) {
        uint256 numPools = _path.numPools();
        address[] memory route = new address[](numPools + 1);
        for (uint256 i; i < numPools; i++) {
            (address tokenA, address tokenB,) = _path.decodeFirstPool();
            route[i] = tokenA;
            route[i + 1] = tokenB;
            _path = _path.skipToken();
        }
        return route;
    }

    // Convert token route to encoded path
    // uint24 type for fees so path is packed tightly
    function routeToPath(
        address[] memory _route,
        uint24[] memory _fee
    ) internal pure returns (bytes memory path) {
        path = abi.encodePacked(_route[0]);
        uint256 feeLength = _fee.length;
        for (uint256 i = 0; i < feeLength; i++) {
            path = abi.encodePacked(path, _fee[i], _route[i+1]);
        }
    }

    // function quoteSingle(
    //     address _quoter,
    //     address _tokenIn,
    //     address _tokenOut,
    //     uint24 _fee,
    //     uint256 _amountIn
    // ) internal returns(uint256) {
    //     return IUniswapV3Quoter(_quoter).quoteExactInputSingle(
    //         _tokenIn, 
    //         _tokenOut,
    //         _fee,
    //         _amountIn,
    //         0
    //     );
    // }
}
